class VectorPhy {
	constructor(x, y) {
		this.x = x || 0;
		this.y = y || 0;
	}
	static pi(theta) {
		return Math.PI/180*theta;
	}
	static applyForce(force, m) {
//m is mass
		return Vector2D.div(force, m);
		//this value is accelaration vector...
	}
	static attract(mouse, p, g, m1, m2) {
		//p is the particle or object.
		//gravitational attraction and repulsion
		//g is the universal gravity constant. inversely propotional to attaraction
		//m1 and m2 is mass

//d = constrain(d,5,100);
		let dir = Vector2D.sub(mouse, p.pos);
		let d = Vector2D.magnitude(dir);
		d = Vector2D.constrain(d, 5, 100);
		dir = Vector2D.normalize(dir);
		let force = (g * m1 * m2) / (d * d);
		dir = Vector2D.mul(dir, force);

		return VectorPhy.applyForce(dir, m2);

		//apply it...
		//var r = Particle.attract(this, this.m);
		//this.acc = Vector2D.add(this.acc, r);
		
		//apply it with eachother
		/*for (var i = 0; i < man.length; i++) {
			if (man[i] !== this) {
				let towards = VectorPhy.attract(man[i], this, 0.4, man[i].m, this.m);
				this.vel = Vector2D.add(this.vel, towards);
				this.pos = Vector2D.add(this.pos, this.vel);
			}
		}*/
	}
	static repel(mouse, p, g) {
		//p is the particle or object.
		//gravitational attraction and repulsion
		//g is the universal gravity constant. inversely propotional to attaraction
		//m1 and m2 is mass

//d = constrain(d,5,100);
		let dir = Vector2D.sub(mouse.pos, p.pos);
		let d = Vector2D.magnitude(dir);
		d = Vector2D.constrain(d, 5, 100);
		dir = Vector2D.normalize(dir);
		let force = (-g * mouse.m * p.m) / (d * d);
		dir = Vector2D.mul(dir, force);

		return VectorPhy.applyForce(dir, mouse.m);
	}
	
	way() {
		let direction = new Vector2D();
		if (Vector2D.distance(this.pos, this.loc) <= 10) {
			let randAngle = Math.random()*360;
			direction = new Vector2D(this.r*Math.cos(randAngle), this.r*Math.sin(randAngle));
			/*if (direction.x < 0) {
				direction.x = -direction.x;
			}
			if(direction.y < 0) {
				direction.y = -direction.y;
			}*/
			
			//console.log(Vector2D.distance(this.pos, direction));
		}
		//console.log(this.loc);
		this.loc = Vector2D.add(this.loc, Vector2D.mul(direction, 10));
	}
	static direction(p) {
		//let dir = Vector2D.normalize(Vector2D.sub(mouse, p.pos));
		let theta = Math.atan2(p.y, p.x);
		return theta;
	}
	static seek(towards, p) {
		let desired = Vector2D.sub(towards, p.pos);
		desired = Vector2D.mul(Vector2D.normalize(desired), p.maxSpd);

		let steer = Vector2D.sub(desired, p.vel);
		//steer = Vector2D.limit(p.maxForce, steer);
		return VectorPhy.applyForce(steer, p.m);
	}
	static steering(towards, p) {

		//towards is a vector not object, 
		//p is 'this'..
		let positionVec = Vector2D.sub(towards, p.pos);
		let d = Vector2D.magnitude(positionVec);//distance
		positionVec = Vector2D.normalize(positionVec);
		let desired;

		//maxspd and maxforce not defined

		if (d < 100) {
			let m = Vector2D.map(d, 0, 100, 0, p.maxSpd);
			desired = Vector2D.mul(positionVec, m);
		}else {
			desired = Vector2D.mul(positionVec, p.maxSpd);
		}

		let steer = Vector2D.sub(desired, p.vel);
		steer = Vector2D.mul(Vector2D.limit(p.maxForce, steer), 1);//for fleeing change to -1

		return VectorPhy.applyForce(steer, p.m);
	}
	static steer(x, y, p) {//away from wall
		let desired = new Vector2D(x, y);
		//Vector2D.mul(desired, p.maxSpd);
		let steerForce = Vector2D.sub(desired, p.vel);
		steerForce = Vector2D.limit(p.maxForce, steerForce);

		return VectorPhy.applyForce(steerForce, p.m);
	}
	static pathFollow(p, path) {
		let g = p.acc;
		//predicting future location by velocity normalization and scaling
		let predict = Vector2D.normalize(p.vel);
		predict = Vector2D.mul(predict, 25);
		let predictPos = Vector2D.add(p.pos, predict);

		let a = Vector2D.sub(predictPos, path.start); // start = path starting point, end is endimg point
		let b = Vector2D.sub(path.end, path.start);
		//console.log(a)
		b = Vector2D.normalize(b);
		b = Vector2D.mul(b, Vector2D.dot(a, b));

		let normalPoint = Vector2D.add(path.start, b);

		let dis = Vector2D.magnitude(Vector2D.sub(predictPos, normalPoint));
		//console.log(dis)
		if (dis > path.rr) {// path radius
			b = Vector2D.normalize(b);
			b = Vector2D.mul(b, 25);
			let target = Vector2D.add(normalPoint, b);
			g = VectorPhy.seek(target, p);
			///g = Mover.applyForce(g, 1);
			//console.log(1)
		}
		return g;
	}
	static seperation(from, p) {
		//'from' is an array.. need to define p.dis in class
		//p.dis is the distance
		let sum = new Vector2D(), steer = new Vector2D();
		let count = 0;

		for (var i = 0; i < from.length; i++) {
			//console.log(from.length)
			if (from[i] == p) continue;

			let d = Vector2D.distance(p.pos, from[i].pos);
			if (d < p.dis+(p.r*2) && d > 0) {
				let diff = Vector2D.sub(p.pos, from[i].pos);
				diff = Vector2D.normalize(diff);

				sum = Vector2D.add(diff, sum);
				count++;
			}
		}
		if (count > 0) {
			//console.log(1)
			let desired = Vector2D.div(sum, count);
			desired = Vector2D.setMag(p.maxSpd, desired);
			steer = Vector2D.sub(desired, p.vel);
			
		}
		steer = Vector2D.limit(p.maxForce, steer);
		//console.log(from.length);
		return VectorPhy.applyForce(steer, p.m);
	}
	static align(from, p) {
		//or attraction
		//from is store array.. need to define p.dis in class
		let sum = new Vector2D(), steer = new Vector2D();
		let count = 0;

		for (var i = 0; i < from.length; i++) {
			//console.log(from.length)
			if (from[i] == p) continue;

			let d = Vector2D.distance(p.pos, from[i].pos);
			if (d < p.adis+p.r && d > 0) {
				sum = Vector2D.add(from[i].vel, sum);
				count++;
			}
		}
		if (count > 0) {
			//console.log(1)
			let desired = Vector2D.div(sum, count);
			desired = Vector2D.setMag(p.maxSpd, desired);
			steer = Vector2D.sub(desired, p.vel);
			
		}
		return steer = Vector2D.limit(p.maxForce, steer);
	}
	static cohesion(from, p) {
		//or attraction
		//from is store array.. need to define p.dis in class
		let sum = new Vector2D(), steer = new Vector2D();
		let count = 0;

		for (var i = 0; i < from.length; i++) {
			//console.log(from.length)
			if (from[i] == p) continue;

			let d = Vector2D.distance(p.pos, from[i].pos);
			if (d < p.cdis+p.r && d > 0) {
				//let diff = Vector2D.sub(from[i].pos, p.pos);
				//diff = Vector2D.normalize(diff);

				sum = Vector2D.add(from[i].pos, sum);
				count++;
			}
		}
		if (count > 0) {
			//console.log(1)
			let desired = Vector2D.div(sum, count);
			desired = Vector2D.setMag(p.maxSpd, desired);
			steer = Vector2D.sub(desired, p.vel);
			
		}
		return steer = Vector2D.limit(p.maxForce, steer);
	}
}


