let red, green, blue, alpha;

class Particle{
	constructor(x, y, color, radius=1) {
		this.pos = new Vector2D(x, y);
		this.vel = new Vector2D();
		this.c = color;

		this.life = 2;

		this.r = radius;
		this.m = Math.floor(radius*Math.random());

		this.Opos = new Vector2D(x, y);
		this.maxSpd = 10;
		this.maxForce = 0.1;


	}
	static steering(towards, p) {
		let positionVec = Vector2D.sub(towards, p.pos);
		let di = Vector2D.magnitude(positionVec);
		positionVec = Vector2D.normalize(positionVec);
		var desired;

		if (di < 100) {
			let m = Vector2D.map(di, 0, 100, 0, p.maxSpd);
			desired = Vector2D.mul(positionVec, m);
		}else {
			desired = Vector2D.mul(positionVec, p.maxSpd);
		}

		let steer = Vector2D.sub(desired, p.vel);
		steer = Vector2D.limit(p.maxForce, steer);
		return steer;
	}

	odraw() {
		ctx.beginPath();
		ctx.fillStyle = this.c;
		ctx.arc(this.Opos.x, this.Opos.y, this.r, 0, Math.PI*2);
		ctx.fill();
		ctx.closePath();
	}
	draw(clr) {
		ctx.beginPath();
		ctx.fillStyle = 'rgba(255, 0, 0, '+clr+')';
		ctx.arc(this.pos.x, this.pos.y, this.r, 0, Math.PI*2);
		ctx.fill();
		ctx.closePath();
	}
	
	update() {
		this.acc = VectorPhy.steering(mouse, this);

		this.life -= 0.05;
		this.vel = Vector2D.add(this.vel, this.acc);
		this.pos = Vector2D.add(this.pos, this.vel);

		if (this.pos.y > this.Opos.y+100000) {
			this.pos.y = this.Opos.y;
		}
		//this.acc = Vector2D.multiply(this.acc, 0);
		this.draw(this.life);
	}
}


img.onload = () => {
	ctx.drawImage(img, 0, 0);
	
	imagedata = ctx.getImageData(0, 0, img.width, img.height);
	dat = imagedata.data;

	for(var y = 0; y < img.height; y += 1) {
	  	for(var x = 0; x < img.width; x += 1) {

	    	if (dat[((img.width * y) + x) * 4] >= 250 && dat[((img.width * y) + x) * 4+1] <= 0) {
	    		red = dat[((img.width * y) + x) * 4];
		    	green = dat[((img.width * y) + x) * 4 + 1];
		    	blue = dat[((img.width * y) + x) * 4 + 2];
		    	alpha = dat[((img.width * y) + x) * 4 + 3];
		    	
		    	var clr = 'rgba('+ red + ',' + green + ',' + blue + ',' + alpha +')';

		    	
		    	store1.push(new Particle(x+100, y+100, clr));
	    	}
	 	}
	}
	//ctx.clearRect(0, 0, canvas.width, canvas.height);
	//ctx.clearRect()
	animation();
}
setInterval(()=>{
	for(var y = 0; y < img.height; y += 5) {
	  	for(var x = 0; x < img.width; x += 5) {

	    	if (dat[((img.width * y) + x) * 4] >= 250 && dat[((img.width * y) + x) * 4+1] <= 0 && Math.random() < 0.1) {
		    	var clr = 'red';

		    	store.push(new Particle(x+100, y+100, clr, 3*Math.random()));
	    	}
	 	}
	}
}, 200);
function animation() {
	ctx.setTransform(1, 0, 0, 1, 0, 0);
	ctx.fillStyle = 'rgba(0,0,0,0.5)';
	ctx.fillRect(0, 0, canvas.width, canvas.height);

	for (var i = 0; i < store.length; i++) {
		if (store[i].life <= -1) {
			//console.log(1)
			store.splice(i, 1);
		}
		if (store.length >= 1) {
			store[i].update();
		}
	}
	
	store1.forEach((balls) => {
		balls.odraw();
	});

	requestAnimationFrame(animation);
}
